import React from 'react';
import '../App.css';

const Card = ({card}) => {
    // useEffect( () => {

    // },[]);

    return (
        <div>
            <h1>Bingo</h1>
            <div className="animalCont">
                {
                    card && card.map( animal => {
                        return (
                            <div className="animalCell">
                                <h2>{animal.name}</h2>
                                <img className="animalImage" src={animal.picture} alt={animal.name}/>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    )
}

export default Card;
